import ipaddress

def count_ips(ip_ranges):
    total_ips = 0
    ranges = ip_ranges.split(",")
    
    for r in ranges:
        if "-" in r:
            start_ip, end_ip = r.split("-")
            total_ips += int(ipaddress.IPv4Address(end_ip)) - int(ipaddress.IPv4Address(start_ip)) + 1
        else:
            total_ips += 1  # Single IP
    
    return total_ips

